import { test, describe } from 'node:test'
import assert from 'node:assert'
import path from 'node:path'
import { MCPConfigParser } from '../src/services/mcp-config-parser.js'

describe('MCPConfigParser', () => {
  describe('parseConfigFile', () => {
    test('should parse valid JSON file with servers key', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/vscode-servers.json')
      const parser = new MCPConfigParser(fixturePath)

      const result = await parser.parseConfigFile()

      assert.strictEqual(result.parsed, true)
      assert.strictEqual(result.valid, true)
      assert.ok(result.raw)
      assert.strictEqual(Object.keys(result.servers).length, 2)
      assert.ok(result.servers['test-server'])
      assert.ok(result.servers['another-server'])
    })

    test('should parse valid JSON file with mcpServers key', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/claude-mcpServers.json')
      const parser = new MCPConfigParser(fixturePath)

      const result = await parser.parseConfigFile()

      assert.strictEqual(result.parsed, true)
      assert.strictEqual(result.valid, true)
      assert.ok(result.raw)
      assert.strictEqual(Object.keys(result.servers).length, 3)
      assert.ok(result.servers['claude-server'])
      assert.ok(result.servers['firecrawl-mcp'])
      assert.ok(result.servers['openai-mcp'])
    })

    test('should parse valid JSON file with context_servers key', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/zed-context_servers.json')
      const parser = new MCPConfigParser(fixturePath)

      const result = await parser.parseConfigFile()

      assert.strictEqual(result.parsed, true)
      assert.strictEqual(result.valid, true)
      assert.ok(result.raw)
      assert.strictEqual(Object.keys(result.servers).length, 1)
      assert.ok(result.servers['zed-server'])
    })

    test('should parse valid JSON file with mcp.servers key', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/vscode-settings-mcp.json')
      const parser = new MCPConfigParser(fixturePath)

      const result = await parser.parseConfigFile()

      assert.strictEqual(result.parsed, true)
      assert.strictEqual(result.valid, true)
      assert.ok(result.raw)
      assert.strictEqual(Object.keys(result.servers).length, 1)
      assert.ok(result.servers['global-server'])
    })

    test('should handle config file with mcpServers key', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp.json')
      const parser = new MCPConfigParser(fixturePath)

      const result = await parser.parseConfigFile()

      assert.strictEqual(result.parsed, true)
      assert.strictEqual(result.valid, true)
      assert.ok(result.raw)
      assert.strictEqual(Object.keys(result.servers).length, 1)
      assert.ok(result.servers['server-name'])
    })

    test('should throw error for invalid JSON file', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/invalid-json.jsonc')
      const parser = new MCPConfigParser(fixturePath)

      await assert.rejects(async () => {
        await parser.parseConfigFile()
      }, /Failed to parse configuration file/)
    })
  })

  describe('extractMCPServers', () => {
    test('should extract servers from servers key', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/vscode-servers.json')
      const parser = new MCPConfigParser(fixturePath)

      const result = await parser.parseConfigFile()

      assert.strictEqual(Object.keys(result.servers).length, 2)
      assert.ok(result.servers['test-server'])
      assert.ok(result.servers['another-server'])
    })

    test('should extract servers from mcpServers key', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/claude-mcpServers.json')
      const parser = new MCPConfigParser(fixturePath)

      const result = await parser.parseConfigFile()

      assert.strictEqual(Object.keys(result.servers).length, 3)
      assert.ok(result.servers['claude-server'])
      assert.ok(result.servers['firecrawl-mcp'])
      assert.ok(result.servers['openai-mcp'])
    })

    test('should extract servers from context_servers key', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/zed-context_servers.json')
      const parser = new MCPConfigParser(fixturePath)

      const result = await parser.parseConfigFile()

      assert.strictEqual(Object.keys(result.servers).length, 1)
      assert.ok(result.servers['zed-server'])
    })

    test('should extract servers from mcp.servers key', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/vscode-settings-mcp.json')
      const parser = new MCPConfigParser(fixturePath)

      const result = await parser.parseConfigFile()

      assert.strictEqual(Object.keys(result.servers).length, 1)
      assert.ok(result.servers['global-server'])
    })

    test('should handle all transport types including streamable-http', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/mixed-transport-types.json')
      const parser = new MCPConfigParser(fixturePath)

      const result = await parser.parseConfigFile()
      const servers = result.servers

      assert.ok(servers)
      assert.strictEqual(Object.keys(servers).length, 4)

      // Check all transport types are correctly parsed
      assert.strictEqual(servers['stdio-server'].type, 'stdio')
      assert.strictEqual(servers['sse-server'].type, 'sse')
      assert.strictEqual(servers['http-server'].type, 'http')
      assert.strictEqual(servers['streamable-http-server'].type, 'streamable-http')
    })

    test('should infer transport types when type field is not explicitly set', async () => {
      // Test transport inference using the existing mixed-transport-types fixture
      // which has explicit types, but we can test the inference logic separately
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/mixed-transport-types.json')
      const parser = new MCPConfigParser(fixturePath)

      const result = await parser.parseConfigFile()
      const servers = result.servers

      assert.ok(servers)
      assert.strictEqual(Object.keys(servers).length, 4)

      // Verify that servers with explicit types are correctly parsed
      assert.strictEqual(servers['stdio-server'].type, 'stdio')
      assert.strictEqual(servers['sse-server'].type, 'sse')
      assert.strictEqual(servers['http-server'].type, 'http')
      assert.strictEqual(servers['streamable-http-server'].type, 'streamable-http')
    })

    test('should correctly infer transport types using all inference rules', async () => {
      const parser = new MCPConfigParser('dummy-path')

      // Test Rule 1: URL-based inference → http
      const urlServerConfig = {
        name: 'url-server',
        url: 'https://example.com/mcp'
      }
      const urlServer = parser['normalizeServerConfigs']({ 'url-server': urlServerConfig })
      assert.strictEqual(urlServer['url-server'].type, 'http', 'URL-based server should infer HTTP transport')

      // Test Rule 2-4: Args-based inference
      const stdioArgsConfig = {
        name: 'stdio-args-server',
        command: 'npx',
        args: ['-y', 'stdio-mcp-server', '--stdio']
      }
      const stdioArgsServer = parser['normalizeServerConfigs']({ 'stdio-args-server': stdioArgsConfig })
      assert.strictEqual(stdioArgsServer['stdio-args-server'].type, 'stdio', 'Server with --stdio in args should infer stdio transport')

      const httpArgsConfig = {
        name: 'http-args-server',
        command: 'npx',
        args: ['-y', 'http-mcp-server', '--http', '--port', '3000']
      }
      const httpArgsServer = parser['normalizeServerConfigs']({ 'http-args-server': httpArgsConfig })
      assert.strictEqual(httpArgsServer['http-args-server'].type, 'http', 'Server with --http in args should infer HTTP transport')

      const sseArgsConfig = {
        name: 'sse-args-server',
        command: 'npx',
        args: ['-y', 'sse-mcp-server', '--sse', '--endpoint', '/mcp']
      }
      const sseArgsServer = parser['normalizeServerConfigs']({ 'sse-args-server': sseArgsConfig })
      assert.strictEqual(sseArgsServer['sse-args-server'].type, 'sse', 'Server with --sse in args should infer SSE transport')

      // Test Rule 5: Default fallback → stdio (when command is present but no other indicators)
      const defaultConfig = {
        name: 'default-server',
        command: 'npx',
        args: ['-y', 'generic-mcp-server']
      }
      const defaultServer = parser['normalizeServerConfigs']({ 'default-server': defaultConfig })
      assert.strictEqual(defaultServer['default-server'].type, 'stdio', 'Server with command but no transport indicators should default to stdio')

      // Test case with no transport indicators and no command → undefined
      const noIndicatorsConfig = {
        name: 'no-indicators-server'
        // No command, no url, no args
      }
      const noIndicatorsServer = parser['normalizeServerConfigs']({ 'no-indicators-server': noIndicatorsConfig })
      assert.strictEqual(noIndicatorsServer['no-indicators-server'].type, undefined, 'Server with no indicators should have undefined type')

      // Test the specific regression case that happened: nodejs-api-docs scenario
      const nodejsApiDocsConfig = {
        name: 'nodejs-api-docs',
        command: 'npx',
        args: ['-y', 'mcp-server-nodejs-api-docs']
      }
      const nodejsApiDocsServer = parser['normalizeServerConfigs']({ 'nodejs-api-docs': nodejsApiDocsConfig })
      assert.strictEqual(nodejsApiDocsServer['nodejs-api-docs'].type, 'stdio', 'nodejs-api-docs server should default to stdio transport (regression test)')
    })

    test('should respect transport inference priority (explicit type overrides inference)', async () => {
      const parser = new MCPConfigParser('dummy-path')

      // Test that explicit type takes precedence over URL inference
      const explicitTypeWithUrlConfig = {
        name: 'explicit-http-server',
        type: 'stdio', // Explicit type
        url: 'https://example.com/mcp' // Would normally infer http
      }
      const explicitTypeWithUrlServer = parser['normalizeServerConfigs']({ 'explicit-http-server': explicitTypeWithUrlConfig })
      assert.strictEqual(explicitTypeWithUrlServer['explicit-http-server'].type, 'stdio', 'Explicit type should override URL inference')

      // Test that explicit type takes precedence over args inference
      const explicitTypeWithArgsConfig = {
        name: 'explicit-stdio-server',
        type: 'http', // Explicit type
        command: 'npx',
        args: ['-y', 'stdio-mcp-server', '--stdio'] // Would normally infer stdio
      }
      const explicitTypeWithArgsServer = parser['normalizeServerConfigs']({ 'explicit-http-server': explicitTypeWithArgsConfig })
      assert.strictEqual(explicitTypeWithArgsServer['explicit-http-server'].type, 'http', 'Explicit type should override args inference')
    })
  })

  describe('validateServerConfig', () => {
    test('should validate valid server config', () => {
      const parser = new MCPConfigParser('dummy-path')
      const validConfig = {
        name: 'test-server',
        command: 'npx',
        args: ['test-mcp-server'],
        transport: 'stdio' as const
      }

      const isValid = parser.validateServerConfig(validConfig)
      assert.strictEqual(isValid, true)
    })

    test('should validate all supported transport types', () => {
      const parser = new MCPConfigParser('dummy-path')
      const validConfigs = [
        { name: 'test-server', command: 'npx', type: 'stdio' as const },
        { name: 'test-server', command: 'npx', type: 'sse' as const },
        { name: 'test-server', command: 'npx', type: 'http' as const },
        { name: 'test-server', command: 'npx', type: 'streamable-http' as const }
      ]

      for (const config of validConfigs) {
        const isValid = parser.validateServerConfig(config)
        assert.strictEqual(isValid, true, `Config with type '${config.type}' should be valid`)
      }
    })

    test('should reject invalid server config without name', () => {
      const parser = new MCPConfigParser('dummy-path')
      const invalidConfig = {
        command: 'npx',
        args: ['test-mcp-server'],
        transport: 'stdio' as const
      } as any

      const isValid = parser.validateServerConfig(invalidConfig)
      assert.strictEqual(isValid, false)
    })

    test('should reject invalid server config without command', () => {
      const parser = new MCPConfigParser('dummy-path')
      const invalidConfig = {
        name: 'test-server',
        args: ['test-mcp-server'],
        transport: 'stdio' as const
      } as any

      const isValid = parser.validateServerConfig(invalidConfig)
      assert.strictEqual(isValid, false)
    })

    test('should reject null config', () => {
      const parser = new MCPConfigParser('dummy-path')
      const isValid = parser.validateServerConfig(null as any)
      assert.strictEqual(isValid, false)
    })
  })

  describe('getSupportedConfigKeys', () => {
    test('should return supported configuration keys', () => {
      const parser = new MCPConfigParser('dummy-path')
      const keys = parser.getSupportedConfigKeys()

      assert.ok(Array.isArray(keys))
      assert.ok(keys.includes('servers'))
      assert.ok(keys.includes('mcpServers'))
      assert.ok(keys.includes('context_servers'))
    })
  })

  describe('isValidSyntax', () => {
    test('should return true for valid JSON file', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/vscode-servers.json')
      const parser = new MCPConfigParser(fixturePath)

      const isValid = await parser.isValidSyntax()
      assert.strictEqual(isValid, true)
    })

    test('should return false for invalid JSON file', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/invalid-json.jsonc')
      const parser = new MCPConfigParser(fixturePath)

      const isValid = await parser.isValidSyntax()
      assert.strictEqual(isValid, false)
    })
  })

  describe('countMCPServers', () => {
    test('should count servers in valid config file', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp-config-service/vscode-servers.json')
      const parser = new MCPConfigParser(fixturePath)

      const count = await parser.countMCPServers()
      assert.strictEqual(count, 2)
    })

    test('should return 1 for config file with mcpServers', async () => {
      const fixturePath = path.resolve('__tests__/__fixtures__/mcp.json')
      const parser = new MCPConfigParser(fixturePath)

      const count = await parser.countMCPServers()
      assert.strictEqual(count, 1)
    })
  })
})

import fs from 'node:fs/promises'
import { parse } from 'jsonc-parser'
import { type MCPConfigData, type MCPServerConfig } from '../types/mcp-config-service.types.js'

export class MCPConfigParser {
  private filePath: string
  private fileContents: string | null = null
  private parsed: boolean = false
  private valid: boolean = false
  private fileContentsData: any | null = null

  constructor (filePath: string) {
    this.filePath = filePath
  }

  /**
   * Parse the configuration file and return structured data
   */
  async parseConfigFile (): Promise<MCPConfigData> {
    if (this.parsed) {
      return {
        raw: this.fileContentsData,
        parsed: this.parsed,
        valid: this.valid,
        servers: await this.extractMCPServers(this.fileContentsData)
      }
    }

    this.parsed = true
    const fileContent = await this.getFileContent()

    // Try parsing as standard JSON first
    try {
      this.fileContentsData = JSON.parse(fileContent)
      if (typeof this.fileContentsData === 'object') {
        this.valid = true
      }
    } catch (e) {
      // Ignore JSON parse errors, try JSONC next
    }

    // Try parsing as JSONC if standard JSON failed
    if (!this.valid) {
      try {
        this.fileContentsData = parse(fileContent)
        if (typeof this.fileContentsData === 'object') {
          this.valid = true
        }
      } catch (error) {
        // Ignore JSONC parse errors
      }
    }

    // @TODO: Add support for YAML and other formats in the future

    if (!this.valid) {
      throw new Error(`Failed to parse configuration file: ${this.filePath}`)
    }

    return {
      raw: this.fileContentsData,
      parsed: this.parsed,
      valid: this.valid,
      servers: await this.extractMCPServers(this.fileContentsData)
    }
  }

  /**
   * Extract MCP servers from parsed configuration data
   */
  async extractMCPServers (configData: any): Promise<Record<string, MCPServerConfig>> {
    if (!configData || typeof configData !== 'object') {
      return {}
    }

    // VS Code uses `servers`
    if (configData.servers && typeof configData.servers === 'object') {
      return this.normalizeServerConfigs(configData.servers)
    }

    // VS Code global settings.json file uses `mcp` -> `servers`
    if (configData.mcp?.servers && typeof configData.mcp.servers === 'object') {
      return this.normalizeServerConfigs(configData.mcp.servers)
    }

    // Claude and Cursor use the `mcpServers` key
    if (configData.mcpServers && typeof configData.mcpServers === 'object') {
      return this.normalizeServerConfigs(configData.mcpServers)
    }

    // Zed uses `context_servers` key
    if (configData.context_servers && typeof configData.context_servers === 'object') {
      return this.normalizeServerConfigs(configData.context_servers)
    }

    return {}
  }

  /**
   * Normalize server configurations to ensure consistent structure
   */
  private normalizeServerConfigs (servers: Record<string, any>): Record<string, MCPServerConfig> {
    const normalized: Record<string, MCPServerConfig> = {}

    for (const [serverName, serverConfig] of Object.entries(servers)) {
      if (serverConfig && typeof serverConfig === 'object') {
        const env = serverConfig.env && typeof serverConfig.env === 'object' ? serverConfig.env : undefined

        normalized[serverName] = {
          name: serverName,
          command: serverConfig.command || '',
          args: Array.isArray(serverConfig.args) ? serverConfig.args : undefined,
          type: this.validateType(serverConfig.type) ? serverConfig.type : this.inferTransportType(serverConfig),
          url: serverConfig.url,
          env
        }
      }
    }

    return normalized
  }

  /**
   * Validate type value
   */
  private validateType (type: any): type is 'sse' | 'http' | 'stdio' | 'streamable-http' {
    return ['sse', 'http', 'stdio', 'streamable-http'].includes(type)
  }

  /**
   * Infer transport type from server configuration when type field is not explicitly set
   */
  private inferTransportType (serverConfig: any): 'sse' | 'http' | 'stdio' | undefined {
    // Rule 1: If URL is present, infer HTTP transport
    if (serverConfig.url && typeof serverConfig.url === 'string') {
      return 'http'
    }

    // Rule 2-4: Search through args array for transport indicators
    if (Array.isArray(serverConfig.args)) {
      const argsString = serverConfig.args.join(' ').toLowerCase()

      // Check for stdio indicators
      if (argsString.includes('stdio')) {
        return 'stdio'
      }

      // Check for HTTP indicators
      if (argsString.includes('http')) {
        return 'http'
      }

      // Check for SSE indicators
      if (argsString.includes('sse')) {
        return 'sse'
      }
    }

    // Rule 5: Default to stdio if command is present but no other indicators found
    // This is a reasonable default since most MCP servers use stdio transport
    if (serverConfig.command && typeof serverConfig.command === 'string') {
      return 'stdio'
    }

    // No transport type could be inferred
    return undefined
  }

  /**
   * Validate server configuration
   */
  validateServerConfig (serverConfig: MCPServerConfig): boolean {
    if (!serverConfig || typeof serverConfig !== 'object') {
      return false
    }

    if (!serverConfig.name || typeof serverConfig.name !== 'string') {
      return false
    }

    if (!serverConfig.command || typeof serverConfig.command !== 'string') {
      return false
    }

    return true
  }

  /**
   * Get supported configuration keys that the parser recognizes
   */
  getSupportedConfigKeys (): string[] {
    return ['servers', 'mcp.servers', 'mcpServers', 'context_servers']
  }

  /**
   * Check if the configuration file has valid syntax
   */
  async isValidSyntax (): Promise<boolean> {
    try {
      const configData = await this.parseConfigFile()
      return configData.valid
    } catch (error) {
      return false
    }
  }

  /**
   * Count the number of MCP servers in the configuration
   */
  async countMCPServers (): Promise<number> {
    try {
      const configData = await this.parseConfigFile()
      return Object.keys(configData.servers).length
    } catch (error) {
      return 0
    }
  }

  /**
   * Get the raw file content
   */
  private async getFileContent (): Promise<string> {
    if (this.fileContents) {
      return this.fileContents
    }

    try {
      this.fileContents = await fs.readFile(this.filePath, 'utf-8')
      return this.fileContents
    } catch (error) {
      throw new Error(`Failed to read file: ${this.filePath}`)
    }
  }
}
